import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import PatientList from "./components/PatientList";

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<PatientList />} />
                <Route path="/add-patient" element={<div>Add Patient Form (Coming Soon)</div>} />
                <Route path="/edit-patient/:id" element={<div>Edit Patient Form (Coming Soon)</div>} />
            </Routes>
        </Router>
    );
};

export default App;
